  test('figma', () async {
    var figmaRepository = FigmaRepository();
    FileResponse response = await figmaRepository.file(
        dotenv.env['FIGMA_API_KEY']!, dotenv.env['FIGMA_FILE_KEY']!);
    var textNodes = <Text>[];
    var node = response.document!.children![0];
    if (node is Canvas) {
      var frame = node.children![0];
      if (frame is Frame) {
        frame.children!.forEach((element) {
          if (element is Text) {
            if (element.name!.startsWith("label_")) {
              textNodes.add(element);
            }
          }
        });
      }
    }
    print(textNodes);
  });
